import React from 'react';
import ImgReact from '../images/reactjs2.svg';
import ImgHtmlCssJs from '../images/html_css_js.svg';
import ImgTailwindCss from '../images/tailwindcss-icon.svg';


const Skills = () => {
  return (
    <div id='skills' className='bg-gradient-to-b from-black via-[#040008] to-[#0e1217] h-[80vh] text-center flex items-center justify-center gap-10 p-12'>
      <div class="backdrop-blur-xl border-2 border-[#eae9e0] rounded-lg bg-transparent shadow-md shadow-[#dee3de] h-96 w-96 mt-16">
      <img src={image} alt="image" className="rounded-xl ml-6 h-22 w-28" />
      </div>
      <div class="backdrop-blur-xl border-2 border-[#eae9e0] rounded-lg bg-transparent shadow-md shadow-[#dee3de] h-96 w-96">
        <img src={image} alt="image" className="rounded-xl ml-6 h-22 w-28" />
      </div>
      <div class="backdrop-blur-xl border-2 border-[#eae9e0] rounded-lg bg-transparent shadow-md shadow-[#dee3de] h-96 w-96 mt-16">
        <img src={image} alt="image" className="rounded-xl ml-6 h-22 w-28" />
      </div>
    </div>
  )
}

export default Skills
